public static double getEuclideanDistance(ArrayList<Double> p1, ArrayList<Double> p2) {
    double sum = 0.0;
    for (int i = 0; i < p1.size(); i++) {
        sum += Math.pow(p1.get(i) - p2.get(i), 2);
    }
    return Math.sqrt(sum);
}
